import { Box } from "@mui/material";
import React from "react";
import { appColor } from "../../../assets/Color";
import Logo from "../../../components/header/Logo";

const Sidebar = () => {
  return (
    <Box
      sx={{
        width: "300px",
        height: "100vh",
        position: "sticky",
        background: `linear-gradient(to bottom, #000, ${appColor.yellow})`,
      }}
    >
      <Box sx={{ margin: "10px", transform: "scale(0.9)" }}>
        <Logo />
      </Box>
      Sidebar
    </Box>
  );
};

export default Sidebar;
